import React from 'react';
import '../App.css';

export const Task = (list) =>{
    return (
        <>
        <ul>
            <li> {list.list.val} </li> 
            <button onClick =  {() => list.list.fun1(list.list.index)} > edit </button> 
            <button onClick =  {() => list.list.fun2(list.list.index)} > delete </button> 
            if( list.list.fun3 != "None"){
            <button onClick =  {() => list.list.fun3(list.list.index)} > completed </button>
            }    
            </ul> 
        </>   
    )
};
